import React from 'react'
import './MainContent.css';
import Image  from '../image/amel.jpeg'
function MainContent() {
  return (
    <div>
        <div className='left'>
      <img src={Image}/></div>
      <div>
        <p>amel sghairi </p>
      </div>
  
    </div>
  )
}

export default MainContent
